KIRTU - SHERLYN - EP 1 - YOUNG, INNOCENT and ABOUT to BECOME A MODEL - An Adult Comic by {(ACF)}

Sherlyn is an exciting new Kirtu original series about a sweet, young and naive small town girl who arrives in the big city of Mumbai to pursue her dream of working in the fashion industry. Will she be able to maintain her innocence or will the highly sexualized world of high fashion drag her down in to the gutter with it? Find out in the brand new title - Sherlyn Episode 1!

